CKEDITOR.plugins.setLang("a11yhelp","ja",{title:"\u30e6\u30fc\u30b6\u30fc\u88dc\u52a9\u306e\u8aac\u660e",contents:"\u30d8\u30eb\u30d7\u3000\u3053\u306e\u30c0\u30a4\u30a2\u30ed\u30b0\u3092\u9589\u3058\u308b\u306b\u306f ESC\u3092\u62bc\u3057\u3066\u304f\u3060\u3055\u3044\u3002",legend:[{name:"\u5168\u822c",items:[{name:"\u30a8\u30c7\u30a3\u30bf\u30fc\u30c4\u30fc\u30eb\u30d0\u30fc",legend:"Press ${toolbarFocus} to navigate to the toolbar. Move to the next and previous toolbar group with TAB and SHIFT-TAB. Move to the next and previous toolbar button with RIGHT ARROW or LEFT ARROW. Press SPACE or ENTER to activate the toolbar button."},{name:"\u7de8\u96c6\u30c0\u30a4\u30a2\u30ed\u30b0",legend:"Inside a dialog, press TAB to navigate to next dialog field, press SHIFT + TAB to move to previous field, press ENTER to submit dialog, press ESC to cancel dialog. For dialogs that have multiple tab pages, press ALT + F10 to navigate to tab-list. Then move to next tab with TAB OR RIGTH ARROW. Move to previous tab with SHIFT + TAB or LEFT ARROW. Press SPACE or ENTER to select the tab page."},{name:"\u30a8\u30c7\u30a3\u30bf\u30fc\u306e\u30e1\u30cb\u30e5\u30fc",legend:"Press ${contextMenu} or APPLICATION KEY to open context-menu. Then move to next menu option with TAB or DOWN ARROW. Move to previous option with SHIFT+TAB or UP ARROW. Press SPACE or ENTER to select the menu option. Open sub-menu of current option with SPACE or ENTER or RIGHT ARROW. Go back to parent menu item with ESC or LEFT ARROW. Close context menu with ESC."},{name:"\u30a8\u30c7\u30a3\u30bf\u30fc\u30ea\u30b9\u30c8\u30dc\u30c3\u30af\u30b9",legend:"Inside a list-box, move to next list item with TAB OR DOWN ARROW. Move to previous list item with SHIFT + TAB or UP ARROW. Press SPACE or ENTER to select the list option. Press ESC to close the list-box."},{name:"\u30a8\u30c7\u30a3\u30bf\u30fc\u8981\u7d20\u30d1\u30b9\u30d0\u30fc",legend:"Press ${elementsPathFocus} to navigate to the elements path bar. Move to next element button with TAB or RIGHT ARROW. Move to previous button with  SHIFT+TAB or LEFT ARROW. Press SPACE or ENTER to select the element in editor."}]},{name:"\u30b3\u30de\u30f3\u30c9",items:[{name:"\u5143\u306b\u623b\u3059",legend:"${undo} \u3092\u30af\u30ea\u30c3\u30af"},{name:"\u3084\u308a\u76f4\u3057",legend:"${redo} \u3092\u30af\u30ea\u30c3\u30af"},{name:"\u592a\u5b57",legend:"${bold} \u3092\u30af\u30ea\u30c3\u30af"},{name:"\u659c\u4f53 ",legend:"${italic} \u3092\u30af\u30ea\u30c3\u30af"},{name:"\u4e0b\u7dda",legend:"${underline} \u3092\u30af\u30ea\u30c3\u30af"},{name:"\u30ea\u30f3\u30af",legend:"${link} \u3092\u30af\u30ea\u30c3\u30af"},{name:"\u30c4\u30fc\u30eb\u30d0\u30fc\u3092\u7e2e\u3081\u308b",legend:"${toolbarCollapse} \u3092\u30af\u30ea\u30c3\u30af"},{name:" Access previous focus space command",legend:"Press ${accessPreviousSpace} to access the closest unreachable focus space before the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:" Access next focus space command",legend:"Press ${accessNextSpace} to access the closest unreachable focus space after the caret, for example: two adjacent HR elements. Repeat the key combination to reach distant focus spaces."},{name:"\u30e6\u30fc\u30b6\u30fc\u88dc\u52a9\u30d8\u30eb\u30d7",legend:"${a11yHelp} \u3092\u30af\u30ea\u30c3\u30af"}]}]});